import React from 'react';
import './App.css';

function Modal(props) {
  return (
    <div className={"modale " + props.isWin}>
        <div className="modal-container">
            <p>GG TU AS WIN !!</p>
            <span onClick={props.closeModale}>X</span>
        </div>
    </div>
  );
}

export default Modal;
